import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';

import './App.css'

function Navi() {
  return (
    <Nav className='Nav' defaultActiveKey="/home" as="ul">
      <Nav.Item >
      <Button href="#">home</Button>
      </Nav.Item>
    </Nav>
  );
}

export default Navi;
